import React from "react";

import produtos from '../../data/produtos'

export default props => {
    const itens = produtos.map(p => {
        return (
            <tr>
                <td>{p.nome}</td>
                <td>R$ {p.preço}</td>
            </tr>
        )
    })

    return (
        <table style={{borderWidth: '1px'}}>
            <th>Nome</th>
            <th>Preço</th>
            {itens}
        </table>
    )
}
